import { Box, Typography } from "@mui/material";
import React from "react";

function PlayStore() {
  return (
    <Box
      sx={{
        display: "grid",
        maxWidth: "100%",
        margin: "0 auto",
        padding: 0,
        height: "550px",
        backgroundColor: "#e3f2fd",
        marginTop: "50px",
      }}
    >
        <Typography>
            Download the <span color="#3593b0">MyMoneyMantra</span>
        </Typography>
    </Box>
  );
}

export default PlayStore;
